import React from 'react';

//const KEY = 'AIzaSyBdXjGbMZ7Yd_W3digAhPLAjnKWACgL5Us';

class Search extends React.Component{
    constructor(){
        super()
        this.state = {
            search: '',
            abc : ''
        }
    }

    handleChange = e => {
        this.setState({value: e.target.value});
    }

    render(){
        return(
            <div>
                <input type='text'  placeholder='Search here' value={this.state.search} onChange={this.handleChange} />
                <input type='text'  placeholder='here' value={this.state.abc} onChange={this.handleChange} />


            </div>
        )
    }

}

export default Search;
